import React from "react";
import "./Clubs.css";
import Navbar from "../Navbar/Navbar";
import Infocards from "./Infocards";

import dummydata from "./dummydata";
import ClubsScript from "./ClubsScript";
import { useState } from "react";

const Clubs = () => {
  const { status, setStatus, clubData, clubsNumberData, filter, setFilter } = ClubsScript();
  const [more , setMore] = useState("More");

    const showMoreCategories = () => {
      const showMore = document.getElementById("more");
      showMore.classList.toggle("increase_height");    
      setMore("Less")  ;
    }
  return (
    <>
      <div className="club_box">
        <div className="club_info">
          <div className="categories_heading">
            <div className="heading">
              <h2>CATEGORIES</h2>
            </div>
            <div className="category_list" id="more">
              <ul>
                <li
                  onClick={() => {
                    setFilter("");
                  }}
                >
                   All
                </li>
                <li
                  onClick={() => {
                    setFilter("üåê Web3");
                  }}
                >
                  üåê Web3
                  {Object.keys(clubsNumberData).length > 0 &&
                    "(" + clubsNumberData["üåê Web3"] + ")"}
                </li>
                <li
                  onClick={() => {
                    setFilter("ü™ê Metaverse");
                  }}
                >
                  ü™ê Metaverse
                  {Object.keys(clubsNumberData).length > 0 &&
                    "(" + clubsNumberData["ü™ê Metaverse"] + ")"}
                </li>
                <li
                  onClick={() => {
                    setFilter("üè¶ DeFi");
                  }}
                >
                  üè¶ DeFi
                  {Object.keys(clubsNumberData).length > 0 &&
                    "(" + clubsNumberData["üè¶ DeFi"] + ")"}
                </li>
                <li
                  onClick={() => {
                    setFilter("üéÆ GameFi");
                  }}
                >
                  üéÆ GameFi
                  {Object.keys(clubsNumberData).length > 0 &&
                    "(" + clubsNumberData["üéÆ GameFi"] + ")"}
                </li>
                <li
                  onClick={() => {
                    setFilter("üíñ SocialFi");
                  }}
                >
                  üíñ SocialFi
                  {Object.keys(clubsNumberData).length > 0 &&
                    "(" + clubsNumberData["üíñ SocialFi"] + ")"}
                </li>
                <li
                  onClick={() => {
                    setFilter("üñº NFT");
                  }}
                >
                  üñº NFT
                  {Object.keys(clubsNumberData).length > 0 &&
                    "(" + clubsNumberData["üñº NFT"] + ")"}
                </li>
                <li
                  onClick={() => {
                    setFilter("üó≥Ô∏è DAO");
                  }}
                >
                  üó≥Ô∏è DAO
                  {Object.keys(clubsNumberData).length > 0 &&
                    "(" + clubsNumberData["üó≥Ô∏è DAO"] + ")"}
                </li>
                <li
                  onClick={() => {
                    setFilter("‚ö° Layer2");
                  }}
                >
                  ‚ö° Layer2
                  {Object.keys(clubsNumberData).length > 0 &&
                    "(" + clubsNumberData["‚ö° Layer2"] + ")"}
                </li>
                <li
                  onClick={() => {
                    setFilter("üîê Crypto");
                  }}
                >
                  üîê Crypto
                  {Object.keys(clubsNumberData).length > 0 &&
                    "(" + clubsNumberData["üîê Crypto"] + ")"}
                </li>
                <li
                  onClick={() => {
                    setFilter("üí© Meme");
                  }}
                >
                  üí© Meme
                  {Object.keys(clubsNumberData).length > 0 &&
                    "(" + clubsNumberData["üí© Meme"] + ")"}
                </li>
                <li
                  onClick={() => {
                    setFilter("üè∑Ô∏è Others");
                  }}
                >
                  üè∑Ô∏è Others
                  {Object.keys(clubsNumberData).length > 0 &&
                    "(" + clubsNumberData["üè∑Ô∏è Others"] + ")"}
                </li>
              </ul>
            </div>
            <button onClick={() => {
                showMoreCategories();
            } }   className="more_categories" >{more}</button>

          </div>
          <div className="pagination_button">


          <div className="categories_information">
            {clubData.length > 0 &&
              clubData.map((club, index) => {
                if (filter === club.category || filter === "") {
                  return (
                    <Infocards
                      key={club.name}
                      heading={club.name}
                      about={club.description}
                      members={club.members}
                      category={club.category}
                      profilepic={club.profilepic}
                      id={club.id}
                    />
                  );
                }
              })}
          </div>

          </div>

          <div className="status">{status}</div>
        </div>
      </div>
    </>
  );
};

export default Clubs;
